import React, { Component } from 'react';

class Display extends Component {


    updateDisplay = () => {
        console.log(this.props.text);
      }
    render () {
        return(

            <button className = {this.props.classes} text = {this.props.text} onClick = {this.updateDisplay}>{this.props.text}</button>
        )
    }
}

export default Display;
